import './App.css';

function App() {
  return (
    <div className="nav-bg">
        <nav className="nav-ppal">
            <h3> <a className="nav-titulo" href="index.html">Healthy Nutrition</a> </h3>
            <div className="nav-botones">
                <a className="boton">Login</a>
                <a className="boton" >Tablas</a>
            </div>  
        </nav>
    </div>
  );
}

export default App;
